import React from 'react';
import './Useroutput.css'
const userOutput=(props)=>{
    return (
        <div className='UserOutput'><p>  Username:{props.userName}   With every breath we take, every drop we drink, we're connected to the ocean.
Our planet depends on the vitality of the ocean to
support and sustain it. 
         </p>

</div>



    )
}



export default userOutput;
